import React, {Component, Fragment} from 'react';
import {Button, Col, Container, Row} from "react-bootstrap";
import {Link} from "react-router-dom";
import RestClient from "../../RestAPI/RestClient";
import AppUrl from "../../RestAPI/AppUrl";


class TopBanner extends Component {

    componentDidMount() {
        RestClient.GetRequest(AppUrl.HomeTitle)
    
    }


    render() {
        return (
            <Fragment>
                <Container fluid={true} className="topFixedBanner p-0">
                    <div className="topBannerOverlay">
                        <Container className="topContent">
                            <Row>
                                <Col className="text-center">
                                    <h1 className="topTitle">Make Your Own Dream</h1>
                                    <h4 className="topSubTitle">Vacant Real Estate Sites</h4>
                                    <Button variant="primary"><Link className="linkStyle"
                                                                    to="/contact">MORE INFO</Link></Button>
                                </Col>
                            </Row>
                        </Container>
                    </div>
                </Container>
            </Fragment>
        );
    }
}

export default TopBanner;
